import React, {Component} from 'react';
import Cardlist from './Cardlist'
import {robots} from './robots.js'
import SearchBox from './SearchBox'



class App extends Component {
    constructor(){
        super()
        this.state = {
            robots: robots,
            searchfield: ''
        }
    }
    render(){
        return(
        <div className='tc'>
        <h1>Robofriends</h1>
        <SearchBox/>
        <Cardlist robots={this.state.robots}/>



        </div>
    )

    }

}

export default App;
